import Vue from 'vue'
import App from './App.vue'
import router from './router'
import store from './store';
import httpRequest from "./utils/httpRequest.js";

Vue.config.productionTip = false;
Vue.mixin({
  methods:{
      leftClick(){
          console.log(1)
      },
      backRouter(){
          console.log('backRouter')
      }
  }
})

Vue.prototype.$http = httpRequest;

new Vue({
  router,
  store,
  render: h => h(App)
}).$mount('#app')
